class DigitClassifierV7Output : MLFeatureProvider {

    /// Source provided by CoreML
    private let provider : MLFeatureProvider

    /// label as integer value
    var label: Int64 {
        provider.featureValue(for: "label")!.int64Value
    }

    /// labelProbability as dictionary of 64-bit integers to doubles
    var labelProbability: [Int64 : Double] {
        provider.featureValue(for: "labelProbability")!.dictionaryValue as! [Int64 : Double]
    }

    var featureNames: Set<String> {
        provider.featureNames
    }

    func featureValue(for featureName: String) -> MLFeatureValue? {
        provider.featureValue(for: featureName)
    }

    init(label: Int64, labelProbability: [Int64 : Double]) {
        self.provider = try! MLDictionaryFeatureProvider(dictionary: ["label" : MLFeatureValue(int64: label), "labelProbability" : MLFeatureValue(dictionary: labelProbability as [AnyHashable : NSNumber])])
    }

    init(features: MLFeatureProvider) {
        self.provider = features
    }
}


